const banks: Consent[] = []
const ecommerce: Consent[] = []

company.consents.forEach((consent) => {
  if (['paypal', 'paypal_eu', 'stripe'].includes(consent.institutionId)) {
    ecommerce.push(consent)
  } else if (!consent.institution.manual && consent.nickname !== 'Friday Finance') {
    banks.push(consent)
  }
})

return {
  BanksConnectionsCount: banks.length,
  CommerceIntegrationsCount: ecommerce.length,
}
